import me from './mee.jpg';
import './App.css';
import Navbar from './Navbar';

function App() {
  return (
    <div className="App">
       <Navbar />
      <p>Hi there, Shubhada here </p>
      <div className='justify-center ml-48 w-72'>
      <img src={me} className="me" alt="Image"/>
      </div>  
    </div>
  );
}

export default App;
